import React from 'react';
import {

  FormControl,

  Typography,
} from '@mui/material';
import { Box } from '@mui/joy';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import Slider from '@mui/material/Slider';
import Header from './Header';
import BasicCard from './Cards';
import CustomIcons from './Pagination';


const optionsCat = [
  { id: '1', label: 'Литые елки' },
  { id: '2', label: 'Уличные елки' },
  { id: '3', label: 'Елки с лампочками' },
  { id: '4', label: 'Заснежные елки' },
  { id: '5', label: 'Комбинированные елки' },
  { id: '6', label: 'Настольные елки' },
];

const optionsHeigth = [
  { id: '1', label: '100 см' },
  { id: '2', label: '110 см' },
  { id: '3', label: '110 см' },
  { id: '4', label: '110 см' },
  { id: '5', label: '110 см' },
  { id: '6', label: '110 см' },
  { id: '7', label: '110 см' },
  { id: '8', label: '110 см' },
  { id: '9', label: '110 см' },
  { id: '10', label: '110 см' },
  { id: '11', label: '110 см' },
];

const optionsRadius = [
  { id: '1', label: '50 см' },
  { id: '2', label: '50 см' },
  { id: '3', label: '50 см' },
  { id: '4', label: '50 см' },
  { id: '5', label: '50 см' },
  { id: '6', label: '50 см' },
];

export default function FormControlLabelPosition() {
  const [heigth, setHeigth] = React.useState('');

  const handleChangeHeigth = (event) => {
    setHeigth(event.target.value);
  };
  return (
    <Box display={'flex'} flexDirection={'column'} textAlign={'center'}>
      <Header/>
      <Box display={'flex'} flexDirection={'row'} justifyContent={'space-between'} marginTop={'100px'}>
      <FormControl sx={{ m: 1, minWidth: 120 }} size='small'>
          <InputLabel id='demo-select-small-label'>Категории</InputLabel>
          <Select
            labelId='demo-select-small-label'
            id='demo-select-small'
            value={heigth}
            label='Age'
            onChange={handleChangeHeigth}
            sx={{ width: '150px' }}
          >
            {optionsCat.map(({ id, label }) => (
              <MenuItem key={id} value={id}>
                {label}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
      </Box>

    </Box>
  );
}
